backend.tf.code:
terraform {
  backend "s3" {
    bucket     = "cloud-ai-demo-infra"
    key        = "cloud-ai/cicd-agent.tfstate"
    region     = "us-east-1"
    encrypt    = true
    # Optionally enable DynamoDB for state locking
    # dynamodb_table = "my-lock-table"
  }
}

./modules/vpc/main.tf.code:
resource "aws_vpc" "main" {
  cidr_block           = var.cidr_block
  enable_dns_support   = true
  enable_dns_hostnames = true

  tags = {
    Name = "cloud-ai-vpc"
  }
}

resource "aws_subnet" "main" {
  count                   = length(var.subnet_cidr_blocks)
  vpc_id                  = aws_vpc.main.id
  cidr_block              = element(var.subnet_cidr_blocks, count.index)
  availability_zone       = element(var.availability_zones, count.index)
  map_public_ip_on_launch = true

  tags = {
    Name = "cloud-ai-subnet-${count.index}"
  }
}

resource "aws_internet_gateway" "main" {
  vpc_id = aws_vpc.main.id

  tags = {
    Name = "cloud-ai-igw"
  }
}

resource "aws_route_table" "main" {
  vpc_id = aws_vpc.main.id

  route {
    cidr_block = "0.0.0.0/0"
    gateway_id = aws_internet_gateway.main.id
  }

  tags = {
    Name = "cloud-ai-route-table"
  }
}

resource "aws_route_table_association" "main" {
  count = length(aws_subnet.main)

  subnet_id      = element(aws_subnet.main.*.id, count.index)
  route_table_id = aws_route_table.main.id
}

./modules/vpc/variables.tf.code:
variable "cidr_block" {
  description = "The CIDR block for the VPC."
  type        = string
}

variable "subnet_cidr_blocks" {
  description = "The list of subnets CIDR blocks."
  type        = list(string)
}

variable "availability_zones" {
  description = "The list of availability zones."
  type        = list(string)
}

./modules/vpc/outputs.tf.code:
output "vpc_id" {
  description = "The ID of the VPC."
  value       = aws_vpc.main.id
}

output "subnet_ids" {
  description = "The list of subnet IDs."
  value       = aws_subnet.main.*.id
}

output "internet_gateway_id" {
  description = "The ID of the Internet Gateway."
  value       = aws_internet_gateway.main.id
}

./modules/ec2/main.tf.code:
resource "aws_security_group" "asg_security_group" {
  name        = "cloud-ai-asg-sg"
  description = "Security group for Autoscaling Group EC2 instances"
  vpc_id      = var.vpc_id

  egress {
    from_port   = 0
    to_port     = 0
    protocol    = "-1"
    cidr_blocks = ["0.0.0.0/0"]
  }

  ingress {
    from_port   = 80
    to_port     = 80
    protocol    = "tcp"
    cidr_blocks = [var.alb_access_cidr]
  }
}

resource "aws_launch_configuration" "asg_launch_configuration" {
  name_prefix                 = "cloud-ai-launch-configuration-"
  image_id                    = var.ami_id
  instance_type               = var.instance_type
  security_groups             = [aws_security_group.asg_security_group.id]
  user_data                   = file("${path.module}/userdata.sh")
  associate_public_ip_address = true

  lifecycle {
    create_before_destroy = true
  }
}

resource "aws_autoscaling_group" "asg" {
  name_prefix           = "cloud-ai-asg-"
  launch_configuration  = aws_launch_configuration.asg_launch_configuration.id
  vpc_zone_identifier   = var.subnet_ids
  min_size              = var.asg_min_size
  max_size              = var.asg_max_size
  desired_capacity      = var.asg_desired_capacity
  health_check_type     = "EC2"

  tag {
    key                 = "Name"
    value               = "cloud-ai-instance"
    propagate_at_launch = true
  }

  lifecycle {
    create_before_destroy = true
  }
}

resource "aws_lb" "alb" {
  name               = "cloud-ai-alb"
  internal           = false
  load_balancer_type = "application"
  security_groups    = [aws_security_group.asg_security_group.id]
  subnets            = var.subnet_ids

  enable_deletion_protection = false
}

resource "aws_lb_target_group" "asg_target_group" {
  name     = "cloud-ai-target-group"
  port     = 80
  protocol = "HTTP"
  vpc_id   = var.vpc_id

  health_check {
    interval            = 30
    path                = "/"
    timeout             = 5
    healthy_threshold   = 2
    unhealthy_threshold = 2
    protocol            = "HTTP"
    matcher             = "200-299"
  }
}

resource "aws_lb_listener" "alb_listener" {
  load_balancer_arn = aws_lb.alb.arn
  port              = 80
  protocol          = "HTTP"

  default_action {
    type             = "forward"
    target_group_arn = aws_lb_target_group.asg_target_group.arn
  }
}

./modules/ec2/variables.tf.code:
variable "vpc_id" {
  description = "The ID of the VPC where the resources will be deployed"
  type        = string
}

variable "subnet_ids" {
  description = "List of subnet IDs to place the Autoscaling Group instances in"
  type        = list(string)
}

variable "ami_id" {
  description = "The ID of the AMI to use for the EC2 instances"
  type        = string
  default     = "ami-0b0ea68c435eb488d" # Specified AMI ID for EC2 instances
}

variable "instance_type" {
  description = "The instance type of the EC2 instances"
  type        = string
  default     = "t3.micro" # Default instance type for the EC2 instances
}

variable "asg_min_size" {
  description = "The minimum size of the Autoscaling Group"
  type        = number
  default     = 1
}

variable "asg_max_size" {
  description = "The maximum size of the Autoscaling Group"
  type        = number
  default     = 3
}

variable "asg_desired_capacity" {
  description = "The desired capacity of the Autoscaling Group"
  type        = number
  default     = 1
}

variable "alb_access_cidr" {
  description = "The CIDR block to allow access to the ALB"
  type        = string
  default     = "0.0.0.0/0" # Default to allow access to the ALB from anywhere
}

./modules/ec2/outputs.tf.code:
output "asg_name" {
  description = "The name of the Autoscaling Group"
  value       = aws_autoscaling_group.asg.name
}

output "alb_dns_name" {
  description = "The DNS name of the Application Load Balancer"
  value       = aws_lb.alb.dns_name
}

output "alb_listener_arn" {
  description = "The ARN of the ALB Listener"
  value       = aws_lb_listener.alb_listener.arn
}

./modules/ec2/userdata.sh.code:
#!/bin/bash
echo "Hello, World!" > index.html
nohup busybox httpd -f -p 80 &

./main.tf.code:
provider "aws" {
  region = "us-east-1"
}

module "vpc" {
  source             = "./modules/vpc"
  cidr_block         = var.vpc_cidr_block
  subnet_cidr_blocks = var.vpc_subnet_cidr_blocks
  availability_zones = var.vpc_availability_zones
}

module "ec2" {
  source             = "./modules/ec2"
  vpc_id             = module.vpc.vpc_id
  subnet_ids         = module.vpc.subnet_ids
  ami_id             = var.ec2_ami_id
  instance_type      = var.ec2_instance_type
  asg_min_size       = var.ec2_asg_min_size
  asg_max_size       = var.ec2_asg_max_size
  asg_desired_capacity = var.ec2_asg_desired_capacity
  alb_access_cidr    = var.ec2_alb_access_cidr
}

./variables.tf.code:
variable "vpc_cidr_block" {
  description = "The CIDR block for the VPC."
  type        = string
  default     = "10.0.0.0/16"
}

variable "vpc_subnet_cidr_blocks" {
  description = "The list of CIDR blocks for the subnets in the VPC."
  type        = list(string)
  default     = ["10.0.1.0/24", "10.0.2.0/24"]
}

variable "vpc_availability_zones" {
  description = "The list of availability zones in which to create subnets."
  type        = list(string)
  default     = ["us-east-1a", "us-east-1b"]
}

# EC2 module defaults are defined in module variables file
variable "ec2_ami_id" {}
variable "ec2_instance_type" {}
variable "ec2_asg_min_size" {}
variable "ec2_asg_max_size" {}
variable "ec2_asg_desired_capacity" {}
variable "ec2_alb_access_cidr" {}

